INSERT INTO `events_event` (`id`,`xid`,`title`,`slug`,`description`,`submitted_by_id`,`created`,`modified`,`url`,`image_url`,`video_url`,`concrete_category_id`,`image`,`is_active`)
VALUES
	(1,'http://www.villagevoice.com/events/four-tennis-legends-two-epic-events-one-smashing-evening-2399873/','Four Tennis Legends/Two Epic Events/One Smashing Evening','four-tennis-legendstwo-epic-eventsone-smashing-eve','For once, the billing for this event is not hyperbole: \" Four Tennis Legends/Two Epic Rivalries/One Smashing Event .\"  John McEnroe, Ivan Lendl, Pete Sampras, and Andre Agassi  were all ranked the number one player in the world at least once in their careers and together hold almost 300 ATP-recognized titles. The showdown presents an eight-game pro set between McEnroe and Lendl and best-of-three matches between Sampras and Agassi. Sponsored by the European banking group BNP Paribas as part of their \"Tennis Night in America,\" the meeting of four tennis legends is the perfect opportunity for those longing to hit the courts to see some high-powered action.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/four-tennis-legends-two-epic-events-one-smashing-evening-2399873/','http://media.villagevoice.com/5995626.47.jpg','',2,'event_images/e3de94f060a88b756e3050aa1403ecd54dd8ca55.jpg',1),
	(2,'http://www.villagevoice.com/events/berghain-and-panoramabar-at-the-bunker-2413826/','Berghain and Panoramabar at the Bunker','berghain-and-panoramabar-at-the-bunker','Part of this bill duplicates a solid Bunker lineup from last summer. Marcel Dettman is a resident at Berlin\'s hedonistic Berghain, where his dark minimalism provides a throbbing aural dreamscape for dancing. Steffi plays at the affiliated Panoramabar, when not curating her limited-edition Dolly imprint. This time a British hard techno heavyweight joins them: Schooled as much by Coil and the Art of Noise as by Jeff Mills and Kraftwerk, Surgeon is a unique master of the genre, as he and his wifes live audiovisual set should prove. With residents Spinoza and Eric Cloutier.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/berghain-and-panoramabar-at-the-bunker-2413826/','http://media.villagevoice.com/6023461.47.jpg','',137,'event_images/1cfefa4abed8e7f675f5b2f8f2d12e6e43e913ec.jpg',1),
	(3,'http://www.villagevoice.com/events/repulsion-2411950/','Repulsion','repulsion','Dir. Roman Polanski (1965).\nRoman Polanskis chic, creepy thriller (and first English language feature) was the ultimate in art-house grand guignol, featuring a nervy Chico Hamilton score,f/x swiped from Jean Cocteau, and one of the screens most memorable rabbits, not to mention Catherine Deneuve, as convincing as she is fetching in the role of a psychotic manicurist.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/repulsion-2411950/','http://media.villagevoice.com/6020246.47.jpg','',29,'event_images/3b641f18e1ba4290dfb994987cd6fac69842ec1d.jpg',1),
	(4,'http://www.villagevoice.com/events/the-civilians-2416000/','The Civilians','the-civilians','When Anna Deavere Smith began adapting interviews concerning pressing issues for her one-woman stage verbatim documentaries, she really started something. This pack also turns their transcribed coverage into musicals: \"Let Me Ascertain You\" is the stage-documentary result of what they learned looking closely at the porn industry. The songs are by Michael Friedman, their most prolific (and overrated) tunesmith, and Jill Sobule. They swear there will also be prizes, but will there be a booby prize?',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-civilians-2416000/','http://media.villagevoice.com/6031472.47.jpg','',137,'event_images/1837ac4b39867f9fa47600ffdfdc754fcea59d22.jpg',1),
	(5,'http://www.villagevoice.com/events/dr-john-and-the-lower-911-marco-benevento-2411797/','Dr. John & the Lower 911+Marco Benevento','dr-john-the-lower-911marco-benevento','Dr. John (a/k/a Mac Rebennack) has been enjoying an artistic rebirth with a new band that allows his jazzbo-elder persona to blend with his spiritual gris-gris incarnation. Enjoy his bouncing Crescent City piano stylings and amazing voice--a greasy, grimy, gritty example of the Southern gothic sublime--during this two-night Mardi Gras run that also features one of the city\'s own better funk experimentalists, keyboard renegade Marco Benevento. With High & Mighty Brass Band.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/dr-john-and-the-lower-911-marco-benevento-2411797/','http://media.villagevoice.com/6031477.47.jpg','',137,'event_images/7795e6c899aab6d380b8e009927e3486196d0aa8.jpg',1),
	(6,'http://www.villagevoice.com/events/elliott-sharp-2413993/','Elliott Sharp','elliott-sharp','To paraphrase Varse: The modern-day systems-oriented composer and blues guitarist refuses to die. The Issue Project Room presents a long-overdue overview of composer-multi-instrumentalist  Elliott Sharp  this weekend in the form of a two-night, two-venue 60th-birthday event. Tonight\'s benefit for the nonprofit arts org takes place in  IPR\'s new jewel-box theater in downtown Brooklyn. Sharp will premiere  Trinity  (with writer-narrator-host Steve Buscemi and filmmaker Jo Andres), the double-quartet IPR commission  Occam\'s Razor  and  Boreal . Tomorrow night\'s eight-hour this-is-your-life extravaganza takes place in IPR\'s current Can Factory space. Beginning at 5 p.m., it includes works featuring Sharp\'s Orchestra Carbon ( Flexagons ), his electronics-rocking Bootstrappers, a brain-scrambling eleven-guitar version of SyndaKit, excerpts from Sharp\'s Octal for eight-string guitarbass, and a screening of Bert Shapiro\'s E# documentary,  Doing the Don\'t. ',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/elliott-sharp-2413993/','http://media.villagevoice.com/6024045.47.jpg','',137,'event_images/9a1b0ec906bb4d56bddcb88b7454a12db7ae6b03.jpg',1),
	(7,'http://www.villagevoice.com/events/crimson-gold-2411953/','Crimson Gold','crimson-gold','Dir. Jafar Panahi (2003).\nJafar Panahis deadpan dark comedy begins and ends with a real-time, fixed-camera jewelry-store robbery. As usual with this now-jailed Iranian director, Tehran is a character and there\'s a tremendous, impassive tragicomic performance by nonpro Hossain Emadeddin.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/crimson-gold-2411953/','http://media.villagevoice.com/6020254.47.jpg','',29,'event_images/5348ff1c569ece45f02b0e0898215c2ac29a59a5.jpg',1),
	(8,'http://www.villagevoice.com/events/rendez-vous-with-french-cinema-2413976/','Rendez-Vous With French Cinema','rendez-vous-with-french-cinema','French provocateur Catherine Breillat has long tackled issues of gender and sexuality in her films such as  Fat Girl  and  The Last Mistress . So it\'s no wonder that what\'s lately been of interest to her are the fairy tales of Charles Perrault. In 2009, Breillat adapted his story  Bluebeard , about a husband who murders his disobedient wives, to explore the dangerous lessons learned by the story\'s young female readers. And now she presents  The Sleeping Beauty , which looks at mythologies told throughout history of little girls in danger. Tonight, the outspoken Breillat will discuss  The Sleeping Beauty  at a screening as a part of the 16th annual  Rendez-Vous With French Cinema  series, presented by Unifrance. You can also catch the filmmaker on Monday at IFC (323 Sixth Avenue) for a screening and discussion about Elia Kazan\'s very naughty  Baby Doll , which concerns a husband whose sultry child bride won\'t allow him to touch her. We\'re sure she\'ll have plenty to say about that.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/rendez-vous-with-french-cinema-2413976/','http://media.villagevoice.com/6023805.47.jpg','',29,'event_images/8118698b491c5edc2d9bcf196d81fcf6ab4c6e1a.jpg',1),
	(9,'http://www.villagevoice.com/events/l-627-2411958/','L.627','l627','Dir. Bertrand Tavernier (1992).\nA rambling exercise in nouveau grit, Bertrand Taverniers policier is an engagingly jaunty and discursive drama of life on the Parisian narco beat. Confounding genre expectations, the film has insouciance but no catharsis.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/l-627-2411958/','http://media.villagevoice.com/6020265.47.jpg','',29,'event_images/251058e8baadf7c5b29a384f123dee482809fb97.jpg',1),
	(10,'http://www.villagevoice.com/events/bridget-everett-2413969/','Bridget Everett','bridget-everett','In all the years that  Bridget Everett  has been commanding cabaret stages by stripping down to her undies and singing raunchy love songs accompanied by little more than a bottle of Chardonnay, her mother has never come to Manhattan to see her perform. Imagine that. But everything is about to change when Everetts mom flies in from the other ManhattanKansasto check out tonight\'s show. Everett will be dedicating some new covers to her mom, like Adina Howard\'s \"Freak Like Me\" and Prince\'s \"How Come U Dont Call Me Anymore.\" Naturally, shes not sure how Mom will take it. \"I told her I was nervous that she was coming,\" says Everett, \"and she said, \'You know I think youre perfect just the way you are.\' So I\'m gonna test her.\"',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/bridget-everett-2413969/','http://media.villagevoice.com/6023791.47.jpg','',28,'event_images/6cf2fb6c4d15e7590ac948fe90c8204aac04614d.jpg',1),
	(11,'http://www.villagevoice.com/events/downtown-music-festival-presents-a-trak-art-brut-white-denim-2416010/','\'Downtown Music Festival Presents A-Trak+Art Brut+White Denim\'','downtown-music-festival-presents-a-trakart-brutwhi','Downtown Records flaunts their roster with a line-up that you\'d normally have to wait for CMJ to see--and tonight, you\'ll get it for less than a theater or arena show. The only problem is that you\'ll be worn out by the end of the evening, unless you want to miss an ace turntablist/fashion plate (A-Trak), the most self-conscious bar band since Hold Steady (Art Brut), a genre-defying indie trio (White Denim), an ex-model turned tense rocker (Lissie Trullie), or a fun-time Japanese girl group (the Suzan).',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/downtown-music-festival-presents-a-trak-art-brut-white-denim-2416010/','http://media.villagevoice.com/6031528.47.jpg','',137,'event_images/52445a0b4601a2833e489152e3fc8d0f54909897.jpg',1),
	(12,'http://www.villagevoice.com/events/an-evening-with-nao-bustamante-melted-plotting-out-a-cross-genre-narrative-2389363/','\"An Evening with Nao Bustamante: Melted, Plotting Out a Cross-Genre Narrative\"','an-evening-with-nao-bustamante-melted-plotting-out','',NULL,'2011-03-08 14:00:19','2011-03-08 14:00:19','http://www.villagevoice.com/events/an-evening-with-nao-bustamante-melted-plotting-out-a-cross-genre-narrative-2389363/','','',173,NULL,1),
