	(14,'http://www.villagevoice.com/events/godand-146-s-offices-2389294/','Gods Offices','godas-offices','Dir. Alice Guy Blach (1896).',NULL,'2011-03-08 14:00:19','2011-03-08 14:00:19','http://www.villagevoice.com/events/godand-146-s-offices-2389294/','','',173,NULL,1),
	(15,'http://www.villagevoice.com/events/the-sawdust-parlour-review-2398482/','\'The Sawdust Parlour Review\'','the-sawdust-parlour-review','',NULL,'2011-03-08 14:00:19','2011-03-08 14:00:19','http://www.villagevoice.com/events/the-sawdust-parlour-review-2398482/','','',137,NULL,1),
	(16,'http://www.villagevoice.com/events/nyc-talent-show-2405851/','NYC Talent Show','nyc-talent-show','',NULL,'2011-03-08 14:00:19','2011-03-08 14:00:19','http://www.villagevoice.com/events/nyc-talent-show-2405851/','','',139,NULL,1),
	(17,'http://www.villagevoice.com/events/lecture-odessa-genius-and-death-in-a-city-of-dreams-2358689/','Lecture - Odessa: Genius And Death In A City Of Dreams','lecture-odessa-genius-and-death-in-a-city-of-dream','Author Charles King\'s colorful account of the transformation of one of Europes foremost Jewish cities is told through the stories of its geniuses and villains.',NULL,'2011-03-08 14:00:19','2011-03-08 14:00:19','http://www.villagevoice.com/events/lecture-odessa-genius-and-death-in-a-city-of-dreams-2358689/','','',34,NULL,1),
	(18,'http://www.villagevoice.com/events/western-caravan-2398513/','Western Caravan','western-caravan','',NULL,'2011-03-08 14:00:19','2011-03-08 14:00:19','http://www.villagevoice.com/events/western-caravan-2398513/','','',137,NULL,1),
	(19,'http://www.villagevoice.com/events/pictures-by-women-a-history-of-modern-photography-1796433/','Pictures by Women: A History of Modern Photography','pictures-by-women-a-history-of-modern-photography','Just as the Metropolitan Museum of Art is paying tribute to fashionable women from the past and present, the Museum of Modern Art is also celebrating those with XX chromosomes with  Pictures by Women: A History of Modern Photography . The exhibition, featuring more than 200 works by 120 artists, reveals the essence of womanhood with works by Diane Arbus, Tina Modotti, Cindy Sherman, and Carrie Mae Weems, as well as pictures, collages, videos, and photography-based installations by Yoko Ono, Lorna Simpson, and Kiki Smith. The images depict everything from domestic life (American photographer Gertrude Ksebiers 1899 elegant black-and-white photograph  Blessed Art Thou Among Women  of a young girl in a school uniform alongside her mother in a nightgown) to domestic violence (Nan Goldins Nan  One Month After Being Battered , a 1984 self-portrait of her bruised and bloodied face after her boyfriend beat her up)all powerful examples of the female experience.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/pictures-by-women-a-history-of-modern-photography-1796433/','http://media.villagevoice.com/4759269.47.jpg','',139,'event_images/c52bd5b67a6b0ca4474f2b23d72587dcdfc20587.jpg',1),
	(20,'http://www.villagevoice.com/events/looking-at-music-3-0-2376070/','Looking at Music 3.0','looking-at-music-30','The Beastie Boys, Run-DMC, Sonic Youthif you missed living in the city in the 80s and 90s (or were too young to apprecaite it),  Looking at Music 3.0  takes you back to New Yorks glory days, when art thrived on city walls, underground clubs, and alternative space. This show, the third in a series that explores the influence of music on contemporary art practices, features about 70 pieces that center around the birth of remix culture and the activism that arose in response to the AIDS crisis, the citys financial problems, and the rampant drug use destroying neighborhoods. Artists included are Public Enemy, Kathleen Hanna and Le Tigre, Keith Haring, Christian Marclay, Lee Quinones, and Miranda July, who founded Joanie 4 Jackie, a video chain letter.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/looking-at-music-3-0-2376070/','http://media.villagevoice.com/5940650.47.jpg','',127,'event_images/da9130ebd548631e5831632a341aebd7a171f672.jpg',1),
	(21,'http://www.villagevoice.com/events/brick-and-mortar-the-city-music-project-2394185/','Brick & Mortar+the City Music Project','brick-mortarthe-city-music-project','',NULL,'2011-03-08 14:00:19','2011-03-08 14:00:19','http://www.villagevoice.com/events/brick-and-mortar-the-city-music-project-2394185/','','',137,NULL,1),
	(22,'http://www.villagevoice.com/events/yellow-matter-custard-2390691/','Yellow Matter Custard','yellow-matter-custard','',NULL,'2011-03-08 14:00:19','2011-03-08 14:00:19','http://www.villagevoice.com/events/yellow-matter-custard-2390691/','','',137,NULL,1),
	(23,'http://www.villagevoice.com/events/frigid-festival-2399784/','Frigid Festival','frigid-festival','It\'s been a while since we last got to venue-hop among downtown black-boxes for a theater festival, so Frigid is back to once again fill the void left by those departed warm-weather mega-fests. See how many of the 30 shows you can catch in 12 days. It\'s for a good cause: 100 percent of box-office proceeds go to the artists who created the shows (that doesn\'t usually happen at New York festivals). Some highlights on the largely solo-show roster are  Hi, How Can I Help You? , Scout Durwood\'s one-woman musical comedy about the sex-industry;  My Pal Izzy , Melanie Gall\'s biographical take on Irving Berlin, using some of his lesser-known tunes; and  ONEymoon , Christel Bartelse\'s tale about a woman who marries herself.',NULL,'2011-03-08 14:00:19','2011-03-15 00:19:19','http://www.villagevoice.com/events/frigid-festival-2399784/','http://media.villagevoice.com/5995473.47.jpg','',125,'event_images/1a4123dd5a8deb01814830437901f3f01092c43b.jpg',1),
	(24,'http://www.villagevoice.com/events/philip-lorca-dicorcia-2399807/','Philip-Lorca DiCorcia','philip-lorca-dicorcia','Traveling the world for the fashion magazine  W ,  Philip-Lorca DiCorcia  has photographed subjects ranging from exotic dancers in Havana to Marc Jacobs in his bedroom in Paris. For the first time ever in his 30-year career, the American photographer and reinventor of street photography will exhibit 11 of his fashion portfolios that he and  W  magazine\'s long-time creative director, Dennis Freedman (who is now the creative director at Barneys), worked on together. Featuring locations such as a cockfighting ring in Bangkok and a museum in Cairo, the images will transport you to another world.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/philip-lorca-dicorcia-2399807/','http://media.villagevoice.com/5995501.47.jpg','',127,'event_images/24c3aab6074ac665bdfe079fdaa6262abe5cabf5.jpg',1),
	(25,'http://www.villagevoice.com/events/subject-of-the-question-luster-drum-the-jaguar-2398552/','Subject of the Question+Luster+Drum the Jaguar','subject-of-the-questionlusterdrum-the-jaguar','',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/subject-of-the-question-luster-drum-the-jaguar-2398552/','','',137,NULL,1),
	(26,'http://www.villagevoice.com/events/our-nazi-2389669/','Our Nazi','our-nazi','Dir. Robert Kramer (1985).',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/our-nazi-2389669/','','',173,NULL,1),
	(27,'http://www.villagevoice.com/events/george-condo-2335482/','George Condo','george-condo','Kanye West is no stranger to controversyso for his new album cover, he wanted a like-minded artist to be as out there as he is. Naturally, he approached artist  George Condo . The rapper wanted Condo, who once worked as a printer for Andy Warhol, to create an album cover that would get banned. However, the cover for Wests  My Beautiful Dark Twisted Fantasy , featuring a trippy brightly colored image of a devilish monkey screwing a naked female monster with wings and a tail, never did get bannedin fact, even Wal-Mart was excited to sell it.  Mental States , Condos first major U.S. survey, is just as out there, with more than 80 paintings and sculptures from the past 28 years of the artists career. The exhibition, divided on two floors and separated in chapter form, details the artists unique adaptation of Old Master paintings and has its own share of female monsters and strange monkey people suitable for rock stars and us weirdly normal folk.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/george-condo-2335482/','http://media.villagevoice.com/5862758.47.jpg','',127,'event_images/7f19e3759ae3722a6d1d271b874c62a51a9d9136.jpg',1),
	(28,'http://www.villagevoice.com/events/lynda-benglis-2363532/','Lynda Benglis','lynda-benglis','In 1974, American sculptor artist  Lynda Benglis  posed for  Artforum  wearing nothing but sunglasses and a giant latex dildo. This was her attempt to say, in so many words, that the art world isnt a mans world. Nearly four decades later, we are still taking notice of her brilliant work as the New Museum presents her first major retrospective in more than 20 years. The show includes her infamous poured latex pieces from the 60s and 70s, early bronze casts, wax reliefs, videos, Bengliss largest pour sculpture at almost 40 feet in length titled Contraband, which was first seen at the Whitney, and Phantom, a polyurethane installation consisting of five monumental sculptures that glow in the dark. Well be wearing shades, too.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/lynda-benglis-2363532/','http://media.villagevoice.com/5920031.47.jpg','',127,'event_images/a4900718c276115483c08bd9db31e0f9fbdb3f3b.jpg',1),
	(29,'http://www.villagevoice.com/events/silent-clowns-2414025/','Silent Clowns','silent-clowns','\"It will be funny a thousand years from now,\" Woody Allen has said about the work of silent-film pioneer Charlie Chaplin. Indeed, you don\'t need to understand the language to know when a pratfall is funny.  Silent Clowns  is a new film series of screenings and discussions that explores how Chaplin\'s physical comedy influenced future comedians in film. It starts tonight with  Modern Times , Chaplin\'s 1936 Depression-era masterpiece starring the Little Tramp as a factory worker driven crazy by his monotonous work on the assembly line. After the screening, Saul Austerlitz, author of  Another Fine Mess , will discuss Chaplin\'s work. Upcoming movies in the series are Jerry Lewis\'s  The Bellboy  (March 29), Peter Sellers\'s  The Party  (April 7), and Woody Allen\'s  Zelig  (May 3).',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/silent-clowns-2414025/','http://media.villagevoice.com/6024158.47.jpg','',29,'event_images/6c9b3b357b0893cefe65003ef02337a40949e50c.jpg',1),
	(30,'http://www.villagevoice.com/events/ice-cube-2405991/','Ice Cube','ice-cube','Taking a rare break from making  Are We There Yet?  sequels and TV episodes, family actor Ice Cube has returned to his first love: gangsta rap. After all so many years of having other careers in tandem with hip-hop, he has always comes back swinging. His last album, 2010\'s middling  I Am the West , showed a lot of promise, though, mostly thanks to production from Sir Jinx--the man partly responsible for the sound on Cube\'s early \'90s solo albums. \"Life in California\" in which he takes potshots at Jay-Z and Alicia Keys\' ubiquitous \"Empire State of Mind.\" Once a fighter, always a fighter.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/ice-cube-2405991/','http://media.villagevoice.com/6031607.47.jpg','',137,'event_images/e887575488ae545351c5f48e180d805cf54852c5.jpg',1),
	(31,'http://www.villagevoice.com/events/now-showing-2414031/','Now Showing','now-showing','Jesse Eisenberg did a stellar job portraying the nerdy Facebook creator Mark Zuckerberg in  Social Network , perhaps because he, too, is shy and awkward. Also like Zuckerberg, Eisenberg is very charitable. Tonight, he\'ll give a reading along with actress Lili Taylor at Now Showing, the Alliance for Young Artists & Writers\'s fundraiser for creative scholarships. The night of lit, music, and art also includes a silent auction and the sounds of Rasputina, Max Vernon, and DJ Gilles Wasserman. We\'re going simply to see if Eisenberg will showcase some more of that charming pizzazz we saw on  Saturday Night Live .',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/now-showing-2414031/','http://media.villagevoice.com/6024187.47.jpg','',34,'event_images/e695e34aed6dd2ee8f9f42a37ab013247ee2fc56.jpg',1),
	(32,'http://www.villagevoice.com/events/thirsty-ear-presents-an-evening-of-trio-treats-with-matthew-shipp-trio-2405892/','\'Thirsty Ear Presents an Evening of Trio Treats with Matthew Shipp Trio\'','thirsty-ear-presents-an-evening-of-trio-treats-wit','You can get into all sorts of fistfights and parlor games about who\'s the most innovative jazz pianist around these days: Jason Moran or this New York mainstay. Moran\'s more trad-bound--and, not\ncoincidentally, more feted--but despite Shipp\'s avant-garde roots, his latest disc includes his takes on \"Fly Me to the Moon\" and \"Take the A Train,\" neither of which would upset anyone down the street at Blue Note. His playing is luxurious no matter what style he plumbs, and he\'s still got a lot to prove at 50 years young. With Weasel Walter/Mary Halvorson/Peter Evans Trio.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/thirsty-ear-presents-an-evening-of-trio-treats-with-matthew-shipp-trio-2405892/','http://media.villagevoice.com/6031552.47.jpg','',137,'event_images/26b27c011d493472effe2c160ec9bedab68fad98.jpg',1),
	(33,'http://www.villagevoice.com/events/the-belle-brigade-2412127/','The Belle Brigade','the-belle-brigade','This new L.A. combo finds well-traveled indie-scene drummer Barbara Gruska (who\'s played with Jenny Lewis and the Watson Twins) doing sunshiney, soul-infused folk-pop with her younger brother Ethan. Their handsome, self-titled debut is due out in April, and they\'ll follow this small-room gig by opening for Grace Potter & the Nocturnals at Irving Plaza later this week. With Sneaky Legend, Noah Chernin, and Go Back to the Zoo.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-belle-brigade-2412127/','http://media.villagevoice.com/6031592.47.jpg','',137,'event_images/38075b18dcdec7f1017201429504fd63a31ed9dd.jpg',1),
	(34,'http://www.villagevoice.com/events/good-charlotte-2406248/','Good Charlotte','good-charlotte','It has been a decade since snotty pop-punk marionettes Good Charlotte first ruled (and arguably killed) MTV. Somehow, despite emo rendering pop-punk commercially obsolete, they\'ve managed to maintain their traction and most of their original lineup, even scoring a platinum single in 2007. Now, as most of their pop-punk peers seem to have fallen by the wayside--be it taking up writing Broadway musicals or hosting shows on Fuse--Good Charlotte are still trying to live out their \"Lifestyles of the Rich and Famous.\" Their future is in your hands. With Forever the Sickest Kids and This Century.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/good-charlotte-2406248/','http://media.villagevoice.com/6031586.47.jpg','',137,'event_images/ef5646ffd6355159a1b9fcce1257c72d318b96d1.jpg',1),
	(35,'http://www.villagevoice.com/events/grimes-doldrums-2412099/','Grimes+Doldrums','grimesdoldrums','After a year of calypso gold, Montreal solo artist Grimes will usher in 2011\'s newest influence: lo-fi Enya. Her soaring monosyllabic utterings are matched by a dreamy palette of Eastern influences and glitchy beats--hearts are captured with one bounce of her token Troll-hair updo. Backups Doldrums (Toronto art rock), Megafortress (one man desert-drone), and Toby Aronson (Vermont acoustics) finish off a night at Glasslands that should be Crystal Castles for the unfamiliar. With Alaskas.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/grimes-doldrums-2412099/','http://media.villagevoice.com/6031543.47.jpg','',137,'event_images/a2e9e2fb68f3029d3b73dcf5b2a2ddbffd563fa6.jpg',1),
	(36,'http://www.villagevoice.com/events/the-blue-angel-2411747/','The Blue Angel','the-blue-angel','Dir. Joseph von Sternberg (1930).\nThe great cine-aesthetes first talkie (and only German film) is as stodgy as it is sleazy, as static as it is iconic, in detailing the S&M affair between a meaty, young Marlene Dietrich and a decrepit, old Emil Jannings.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-blue-angel-2411747/','http://media.villagevoice.com/6019821.47.jpg','',29,'event_images/d9dce405a12128eb707de733a8a9267d631b92e5.jpg',1),
	(37,'http://www.villagevoice.com/events/the-woodmans-2411756/','The Woodmans','the-woodmans','Dir. C. Scott Willis (2010).\nThis documentary portrait of the artist, the photographer Francesca Woodman who committed suicide in 1981 at age 22, is also haunting study in family dynamicsthe film leaves the impression that Francescas parents, a strong-willed ceramicist and a stubbornly unfashionable abstract painter, regard their doomed genius child as their greatest work of art.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-woodmans-2411756/','http://media.villagevoice.com/6019826.47.jpg','',29,'event_images/3fe8d6c4115881bb007e1c76a56f49b89ea287ca.jpg',1),
	(38,'http://www.villagevoice.com/events/max-weinberg-big-band-2416015/','Max Weinberg Big Band','max-weinberg-big-band','No longer content to provide the backing music to the Masturbating Bear (the Conan O\'Brien character--not his boss, the Boss), drummer Max Weinberg quit late-night TV last year to continue playing with the E Street band and start the ensemble he\'s leading tonight, the Max Weinberg Big Band. What began as an one-off in December--when the 12-piece group played the music of Count Basie and Buddy Rich--has led to a Monday residency at the Hiro Ballroom beginning tonight. Were that not enough, curious fans can also ask for a \"Mighty Max cocktail.\"',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/max-weinberg-big-band-2416015/','http://media.villagevoice.com/6031553.47.jpg','',137,'event_images/b1ebf49917bb943fc48d301640ed24690a9a2101.jpg',1),
	(39,'http://www.villagevoice.com/events/baby-doll-2411745/','Baby Doll','baby-doll','Dir. Elia Kazan (1956).\nTennessee Williams concocted this mad Actors Studio farce, Kazan\'s only comedy, in which a Mississippi child bride who refuses to allow her glad-handing husband to touch her, gets seduced (maybe) by his hated, ultra-ethnic rival. New York archbishop Francis Cardinal Spellman warned that seeing the movie was in itself a sin.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/baby-doll-2411745/','http://media.villagevoice.com/6019818.47.jpg','',29,'event_images/065a476284997a5eb8b218f7bd3a2859409fc77a.jpg',1),
	(40,'http://www.villagevoice.com/events/tyondai-braxton-2414021/','Tyondai Braxton','tyondai-braxton','Battles was only the beginning. After leaving the New York post-rock collective, composer/singer/guitarist  Tyondai Braxton  vowed to focus on his experimental solo work, and tonight he\'ll get a ringing endorsement from some like-minded conjurors, the Wordless Music Orchestra. His dense symphonics have been well represented in his inquisitive voice and steeped-pedal strings, but the additional creative ensemble will broach new territory in their selections from his 2009 Warp disc  Central Market  and new compositions. Perhaps he has finally set the  Onion  article devoted to him (see Temp Hides Fun, Fulfilling Life From Rest of Office discussing one Ty Braxton) into elegant quatrains. Part of the Tully Scope Festival.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/tyondai-braxton-2414021/','http://media.villagevoice.com/6024108.47.jpg','',137,'event_images/94541faa12c17246bfca66e90f8bce096a7b6904.jpg',1),
	(41,'http://www.villagevoice.com/events/basic-nyc-presents-jeff-mills-2413836/','Basic NYC Presents Jeff Mills','basic-nyc-presents-jeff-mills','Jeff Mills is one of techno\'s living legends: He co-founded Underground Resistance, dominated Detroit underground radio as the Wizard, created his own future-theorist vocabulary, released records on Berlin\'s Tresor and served as a Limelight resident. He\'s taken some forays away from his punishing minimalistic sound by collaborating with the Montpellier Philharmonic Orchestra, writing his own soundtrack for Metropolis, and experimenting with site-specific work, but tonight should find him at his classic best: speed-mixing record after record with an aggressive but sure hand. With residents Sleepy & Boo.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/basic-nyc-presents-jeff-mills-2413836/','http://media.villagevoice.com/6023465.47.jpg','',137,'event_images/4f3ebfb3935455f7d737fa688d3714d8d6c0c4be.jpg',1),
	(42,'http://www.villagevoice.com/events/brooklyn-booze-experiment-2414017/','Brooklyn Booze Experiment','brooklyn-booze-experiment','According to humorist P.G. Wodehouse, \"Alcohol is a misunderstood vitamin,\" and it seems like cook-off professionals Theo Peck and Nick Suarez would agree, as their competition, the  Brooklyn Booze Experiment , at the Bell House, is where amateur chefs will show off their best booze-inspired dishes. From the richest bourbon sauces and braised meats to the most indulgent desserts topped with alcoholic whipped creams, you\'re invited to sample each intoxicating experiment and select the winner, along with expert judges. You can even feel good about blowing your beer money on the event: A portion of ticket sales will help support ovarian cancer research. Wine and dine away!',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/brooklyn-booze-experiment-2414017/','http://media.villagevoice.com/6024081.47.jpg','',38,'event_images/71f0502f8be4f22ea84734d7b73585e5b2fbdd2d.jpg',1),
	(43,'http://www.villagevoice.com/events/middle-brother-dawes-deer-tick-2406079/','Middle Brother+Dawes+Deer Tick','middle-brotherdawesdeer-tick','An indie-country semi-supergroup with members of Dawes, Deer Tick, and Delta Spirit, Middle Brother are like the Crosby Stills & Nash of the Bonnaroo set. (Unless that\'s what Monsters of Folk were?) Tonight, they\'ll play after warm-up sets by Dawes and Deer Tick, which means some kind of all-hands jam seems destined.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/middle-brother-dawes-deer-tick-2406079/','http://media.villagevoice.com/6023458.47.jpg','',137,'event_images/188f7716d37415fd74223f884a5d3805da7f2e87.jpg',1),
	(44,'http://www.villagevoice.com/events/martin-hayes-and-dennis-cahill-2412007/','Martin Hayes & Dennis Cahill','martin-hayes-dennis-cahill','Simpatico is the fruit of dumb luck, hard work, or a combination of the two. Happily, the virtuoso fiddler and insightful guitarist have had it from the get-go; their art is a marvel of shared dynamics that milks all the poignancy from the jigs, reels, and airs comprising their Celtic songbook. Their gentility coincides with a stealthy splash of aggression, and it makes pieces such as \"The Cat in the Corner\" and \"Green Gowned Lass\" both seductive and beguiling.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/martin-hayes-and-dennis-cahill-2412007/','http://media.villagevoice.com/6031545.47.jpg','',137,'event_images/5d03b4d503fc6dc3625987633bd92347b4b28d00.jpg',1),
	(45,'http://www.villagevoice.com/events/the-general-2411758/','The General','the-general','Dir. Buster Keaton & Clyde Bruckman (1926).\nAt once archaic in its pastoral view of America and modern in its vision of the mechanical technology, Keatons Civil War comedy is arguably the most beautiful of his featuresnot least in its amazingly orchestrated locomotive gags.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-general-2411758/','http://media.villagevoice.com/6019885.47.jpg','',29,'event_images/b72263dcf62a9de20f4d09ba3c3ba1a98df4f486.jpg',1),
	(46,'http://www.villagevoice.com/events/smith-westerns-2406027/','Smith Westerns','smith-westerns','Chicago\'s Smith Westerns pushed their way into the indie spotlight with a scraggly, jutting-chin debut for HoZac Records that reveled in its youthful bravado like a teenage motorcycle gang with a death wish. Having moved up to Fat Possum and a fatter production budget for the recent  Dye It Blonde , they now have the means to make the girls cream over their Millennial vigor and glitter rock reduxes. They\'re like a cleaner cut Black Lips who\'d rather kiss your mouth than spit in each other\'s. Expect more from these dudes. With Unknown Mortal Orchestra and Computer Magic.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/smith-westerns-2406027/','http://media.villagevoice.com/6031459.47.jpg','',137,'event_images/8342f92bb722f5abfcb41551cec174b2f7761f7d.jpg',1),
	(47,'http://www.villagevoice.com/events/six-organs-of-admittance-2411781/','Six Organs of Admittance','six-organs-of-admittance','Folksy, surreal guitarist Ben Chasny is an avant-garde talent who often pads his records with odd drones and pauses. In concert, he\'ll probably hover around his more focused riff cycles--they\'re not quite as seductively meditative but are a wise move that will avoid the sort of self-indulgent, six-string fingerpainting that can burden his albums.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/six-organs-of-admittance-2411781/','http://media.villagevoice.com/6031407.47.jpg','',137,'event_images/39da5933034fdcb3b0965c55e938112da39dc023.jpg',1),
	(48,'http://www.villagevoice.com/events/wolkenreise-release-party-hidden-records-2413854/','Wolkenreise Release Party-Hidden Records','wolkenreise-release-party-hidden-records','Hidden Recordings boss Deepak Sharma celebrates his and Dieter Krause\'s new release,  Wolkenreise . Melodic and laidback, their latest slice of Balearic soul features a slew of remixes by artists including John Tejada and DJ Qu, and the latter joins Sharma tonight. With his cohorts on Underground Quality, DJ Qu helped make NY-area house a vital force again; his warm, straightforward sets never disappoint. With Domingo Cava.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/wolkenreise-release-party-hidden-records-2413854/','http://media.villagevoice.com/6023495.47.jpg','',137,'event_images/14fb575f18ebebdf4d78623ab0510b5ad1618f54.jpg',1),
	(49,'http://www.villagevoice.com/events/let-it-end-like-this-2414029/','Let It End Like This','let-it-end-like-this','We know we\'re not the only ones who have fantasized about faking our own death and going undercover to the funeral just to see what people would say about us. Todd Zuniga certainly thinks about it. The co-creator of Literary Death Match (we\'re seeing a pattern here) asked 40 writers, filmmakers, musicians, and others to write their own obituaries for the exhibition  Let It End Like This . The results, contributed by artists from Moby and Tao Lin to Susan Orlean and Eugene Mirman, range from funny to, well, morbid. Other participants include Aaron Garretson, Sam Lipsyte, Sarah McNally, Dinaw Mengestu, James J. Williams III, and Evie Wylde.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/let-it-end-like-this-2414029/','http://media.villagevoice.com/6024181.47.jpg','',127,'event_images/c97e67038456560d4ae111d4a81e983fcd4ae3a2.jpg',1),
	(50,'http://www.villagevoice.com/events/andy-warhol-motion-pictures-2282055/','Andy Warhol: Motion Pictures','andy-warhol-motion-pictures','From the vast Andy Warhol film repertoire, it was his silent black-and-white films from the mid-60s that best conveyed his raw talent and brilliant eye for subtlety. Todays opening of Andy Warhol: Motion Pictures includes his  Screen Tests  (featuring portraits of Lou Reed, Allen Ginsberg, Salvador Dal, Susan Sontag, and Edie Sedgwick), which will be shown on the gallery walls within frames, as well as his early silent black-and-white films (such as  Sleep, Eat, Blow Job , and  Kiss ). A selection of these films are being seen in a way that Warhol had always intended them to be seenslower, the way silent films were viewed from the 1890s through the 1920s. Although they were originally shot at sound-film speed (24 frames per second), for this exhibition, the films have been transferred from 16mm film to DVD at the speed of 16 frames per second.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/andy-warhol-motion-pictures-2282055/','http://media.villagevoice.com/5747520.47.jpg','',127,'event_images/53e14616babce8fbe64f5f32d2bdb45f9a8e1797.jpg',1),
	(51,'http://www.villagevoice.com/events/bright-eyes-2414023/','Bright Eyes','bright-eyes','You wanted a hit? Well,  The People\'s Key  is  Bright Eyes \' most straightforward, nose-to-grindstone rock album yet, and just in time to be a rollicking swan song, as scarily prolific mastermind Conor Oberst has maintained it will be the last for the group (Oberst, Mike Mogis, and Nathaniel Walcot). (He hasn\'t said much to corroborate it lately, though; all theories welcome, with bonus points for Winona conspiracies.) The album\'s pretty Hitler-obsessed, but even that bleak cloud can\'t numb the gorgeous emotional resonance of wafting psychedelia number Haile Selassie and triumphant banner-waver Jejune Stars. Even if you\'ve disparaged emo-rock before, don\'t close the door without opening this window first.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/bright-eyes-2414023/','http://media.villagevoice.com/6024115.47.jpg','',137,'event_images/21037e00eec89c93a6decd004a8bc940c9e6b793.jpg',1),
	(52,'http://www.villagevoice.com/events/vivienne-westwood-1980and-150-89-2414027/','Vivienne Westwood 198089','vivienne-westwood-1980a89','I didn\'t want to be a fashion designer at all, Dame Vivienne Westwood told  The New York Times . I did it to help my boyfriend. Her boyfriend was, of course, Malcolm McLaren, manager of the Sex Pistols. Together, they invented the radical punk style of the \'70ssafety pins, ripped T-shirts, spiked dog collars around the neck. How Westwood went from the streets to the high-fashion runways is the focus of the new exhibit at FIT titled  Vivienne Westwood 198089 . The collection tracks her transition from her 1981 unisex pirate-themed collection to creating styles that were more feminine and structured, gaining her a wider audience and more attention from the mainstream press. The exhibition features highlights from her collections (including her iconic Rocking Horse boots), footage from the runway shows, photographs from magazines, and video interviews with Westwood.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/vivienne-westwood-1980and-150-89-2414027/','http://media.villagevoice.com/6024163.47.jpg','',127,'event_images/e2b3ce1cc97f377786ea98e9e9132307902ef70e.jpg',1),
	(53,'http://www.villagevoice.com/events/annie-gosfield-2416003/','Annie Gosfield','annie-gosfield','Technologies old and new clamor and collide in the world premiere of Gosfield\'s  Daughters of the Industrial Revolution , a concert-length work for acoustic and electric ensembles in ideological opposition. Gosfield has a startling knack for transforming the sounds of science and technology into inventive music: this work contrasts modern electronics with the sounds of the junkyards and sweatshops her immigrant grandparents experienced on the Lower East Side. Stephen Gosling will also perform \"Lightning Slingers and Dead Ringers,\" a work for piano and sampler.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/annie-gosfield-2416003/','http://media.villagevoice.com/6031485.47.jpg','',137,'event_images/75456ba31ef35a7f694d7e8762f03a52c7ef4bbd.jpg',1),
	(54,'http://www.villagevoice.com/events/the-awesome-80s-prom-155028/','The Awesome \'80s Prom','the-awesome-80s-prom','Though I was born too late to enjoy an \'80s prom myself, I may once have actively requested Bon Jovi\'s \"You Give Love a Bad Name\" at a junior high semiformal. Conversely, this interactive show aims to give nostalgia musicals a good name when it invites audiences to drink, dance, and vote for prom king and queen. SOLOSKI.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-awesome-80s-prom-155028/','http://media.villagevoice.com/4216173.47.jpg','',125,'event_images/33baeb76796131ce6cc264420b22b4ca84defbec.jpg',1),
	(55,'http://www.villagevoice.com/events/the-love-doll-days-1and-150-30-2414013/','The Love Doll: Days 130','the-love-doll-days-1a30','If you saw Lena Dunham\'s film  Tiny Furniture , you\'re familiar with the work of her mother,  Laurie Simmons , who starred in the film, more or less as herself, photographing tiny figurines in her Tribeca home just as she does in real life. For her new solo show,  The Love Doll: Days 130 , Simmons ordered two lifelike love dolls from a factory in Japan and posed them lounging around her estate in Connecticutplaying naked with a dog, climbing a wall, and diving into a swimming pool. But perhaps the oddest photo of all is the one of an Asian doll packed inside a cardboard box, waiting for her owner to greet her.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-love-doll-days-1and-150-30-2414013/','http://media.villagevoice.com/6024065.47.jpg','',127,'event_images/36423a514718fd880b17db0d6858c5e68b1270ff.jpg',1),
	(56,'http://www.villagevoice.com/events/the-sleeping-beauty-2411919/','The Sleeping Beauty','the-sleeping-beauty','Catherine Breillat, 2010)  Walter Reade 3/4, 8\nCatherine Breillats latest fractured fairytale is less primal and more convoluted than her version of Bluebeardtricked out with dreams, doubles, and interpolations from Hans Christian Andersenbut equally perverse in its saga of female actualization.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-sleeping-beauty-2411919/','http://media.villagevoice.com/6020225.47.jpg','',29,'event_images/b3a6811a3cc70b6bbcdce6b972dbde5964c65dee.jpg',1),
	(57,'http://www.villagevoice.com/events/asphalt-2411936/','Asphalt','asphalt','Dir. Joe May (1929).\nA dumb but honest police officer (Gustav Frhlich, the young hero of Metropolis) is led astray by a larcenous shady lady (sultry flapper Betty Amann) in this echt Weimar late silent; indeed hes literally overpowered by the force of her sex appeal.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/asphalt-2411936/','http://media.villagevoice.com/6020240.47.jpg','',29,'event_images/1bcc721fdebfba8911dc9f3cf12d1ade4c6459e7.jpg',1),
	(58,'http://www.villagevoice.com/events/je-tand-146-aime-je-tand-146-aime-2411926/','Je taime, je taime','je-taaime-je-taaime','Dir. Alain Resnais (1968).\nNever released in the US and rarely screened, Alain Resnaiss 1968 time-travel fantasy is both goofy and poetica sensationally well-edited succession of flashbacks. As a sci-fi love story it recalls Chris Markers  La Jetee  and anticipates Steven Soderberghs  Solaris  remake.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/je-tand-146-aime-je-tand-146-aime-2411926/','http://media.villagevoice.com/6020234.47.jpg','',29,'event_images/7e9c9cae8abec71e3485ec9dc9078a72e5ccb7b8.jpg',1),
	(59,'http://www.villagevoice.com/events/division-iii-mens-track-and-field-championships-2413979/','Division III Men\'s Track and Field Championships','division-iii-mens-track-and-field-championships','The Violets\' men\'s track team is enjoying a record-setting season, and a strong performance can be expected when they host the  Division III Men\'s Track and Field Championships . Watch for Daniel McKinney, who set a school record in the 200-meter dash on February 19, and freshman Gilson Cortes, whose record McKinney broke. Matt Turlip put in a record-setting performance on the mile (4:06:65) at the Valentine\'s Invitational, the best posting by an NYU student since the school joined Division III in 1982 and placing him seventh-best Division III. Also, in the 3000-meter, Andrew Zitek and Sebastian Schwelm rank in the top 10 in NYU\'s Div III history. Bonus: The Armory Track and Field Center is located in the old Fort Washington Armory, a gorgeous Classical Revival building that is state-of-the-art for track and field events. It\'s also home to the National Track and Field Hall of Fame, which alone is worth the trip uptown.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/division-iii-mens-track-and-field-championships-2413979/','http://media.villagevoice.com/6023817.47.jpg','',2,'event_images/9a73334193887be5c9084ed3403652e86b5b6f50.jpg',1),
	(60,'http://www.villagevoice.com/events/circa-2414015/','Circa','circa','Move over, Barnum and Baileythere\'s a new circus in town. The Australian performance company  Circa  melds choreography and acrobatics andunlike Cirque du Soleilopts for a stripped-down aesthetic, wowing audiences around the globe in prestigious venues such as the Sydney Opera House, Dublin Theatre Festival, and the Barbican in London. Set to a soundtrack that includes Sigur Rs, Leonard Cohen, and Jacquel Brel, its self-titled New York debut features grueling, emotionally charged feats of physical capability. Multi-skilled performers often grimace as they work through intricate, risky routines in which timing and accuracy are everything (for instance, when a woman in red stilettos walks all over a man\'s body, there\'s little room for error). It\'s no surprise that many performers leave visibly battered and bruised.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/circa-2414015/','http://media.villagevoice.com/6024078.47.jpg','',28,'event_images/c9b180879f3187940ed403761c3fe9151c1d8858.jpg',1),
	(61,'http://www.villagevoice.com/events/iranian-theatre-festival-2413891/','Iranian Theatre Festival','iranian-theatre-festival','Ahmadinejad would likely not approve. With its  Iranian Theater Festival , the Brick Theater unfurls a Persian carpet of conversation and performance works, many of them highly experimental, which explore Iranian history and identity. As theater has existed in Iran since 1000 B.C., theyll have quite a lot to draw upon. The festival includes plays in English and Persian on subjects such as murders, suicides, and rabbits; how hard it is to keep a chador on; Hitlers doppelgnger; and the Iran/Iraq War as performed by marionettes. Additional events include an Iranian New Years party, live Skype chats with Iranian citizens, and a panel on controversial visionary director Reza Abdoh staffed with several of his collaborators, including Juliana Francis-Kelly and Tony Torn.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/iranian-theatre-festival-2413891/','http://media.villagevoice.com/6023775.47.jpg','',125,'event_images/dd7acca0c6d25f82f0380f4ab2533a9a51a8e4e8.jpg',1),
	(62,'http://www.villagevoice.com/events/fred-hersch-duos-and-trios-plus-2-2406125/','Fred Hersch Duos & Trios Plus 2','fred-hersch-duos-trios-plus-2','The ultra-poised pianist celebrates a radiant new solo disc by playing in an array of configurations, minus one: solo. The brass and reeds added to his trio will make for a fetching fivesome, but his duos may best illustrate the intimacy that\'s long marked Hersch\'s work. Kate McGarry\'s vocals and Julian Lage\'s guitar should offer fanciful exchanges, and his shared air space with saxophonist Joshua Redman already has local zealots anxious to absorb the action.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/fred-hersch-duos-and-trios-plus-2-2406125/','http://media.villagevoice.com/6015142.47.jpg','',137,'event_images/f7ae947b9b554755bc18cf362cc97486b383de51.jpg',1),
	(63,'http://www.villagevoice.com/events/the-hallway-trilogy-2361498/','The Hallway Trilogy','the-hallway-trilogy','In 1967, Surgeon General William Stewart announced, Its time to close the book on infectious disease. That book still remains open, but in the futuristic world that closes Adam Rapps new play cycle,  The Hallway Trilogy , sickness has indeed been exterminated, except in an East Side tenement museum in which cash-strapped volunteers are infected with antiquated illnesses to delight the public. Each of Rapps new plays take place in that same tenement. The first, set in 1953 concerns an actress; the second, situated in the present, follows a squabbling couple; and the third, which occurs 50 years hence, is the museum piece. Directors Rapp, Daniel Aukin, Trip Cullman, and a cast of downtown luminaries offer these infectious evenings.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-hallway-trilogy-2361498/','http://media.villagevoice.com/5920007.47.jpg','',125,'event_images/5713218efbe658530619e06883746a80dccfd96a.jpg',1),
	(64,'http://www.villagevoice.com/events/4play-1914166/','4Play','4play','Start planning what youll smuggle in to this show by the Flying Karamazov Brothers: a bowling ball, a kitten, a bowl of Jell-O. If you bring it, they will juggle it. This loopy circus show, which enjoyed a successful run earlier this year, combines circus arts, comedy, music, dance, and ample absurdity.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/4play-1914166/','http://media.villagevoice.com/5090512.47.jpg','',125,'event_images/7ab0c45953134fddd3fa37ceb621c77a121a436b.jpg',1),
	(65,'http://www.villagevoice.com/events/armory-show-2414019/','Armory Show','armory-show','If you\'ve missed out on the oodles of art-show openings this year, or have been out of the art-world loop, don\'t fretthe 13th annual  Armory Show , which started Thursday, is your one-two punch for all things art. Once again, the Armory Show presents Armory Arts Week, a series of public programming taking place in a different neighborhood each night. The events include special receptions, open studios, art tours, museum discounts, performances, panels, artist discussions, and parties. Of course the big draw is the Armory Show itself, which features the most important artworks of the 20th and 21st centuries from the world\'s leading galleries. Another big highlight will be the show\'s focus on Latin American art, featuring galleries from Argentina, Brazil, Chile, Colombia, Mexico, Peru, and Venezuela. And don\'t forget to stop by Volta NY, the Armory Show\'s sister fair at 7W (7 West 34th Street), for a collection of edgy solo projects.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/armory-show-2414019/','http://media.villagevoice.com/6024095.47.jpg','',127,'event_images/cc35646fcece43ca91962eb5d9fd5a6379a669a4.jpg',1),
	(66,'http://www.villagevoice.com/events/ethan-iverson-larry-grenadier-and-paul-motian-2415909/','Ethan Iverson, Larry Grenadier & Paul Motian','ethan-iverson-larry-grenadier-paul-motian','The Bad Plus pianist treats his extracurricular activities with a refreshing informality. When he blows through jazz nuggets such as \"Good Bait\" or \"Little Melonae,\" he likes to slap \'em around a bit. The deconstruction comes naturally--Iverson and associates always swing. From Billy Hart to Tootie Heath, he\'s been test-driving elder drummers of late, so his reconnection with superhero Motian should be sweet.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/ethan-iverson-larry-grenadier-and-paul-motian-2415909/','http://media.villagevoice.com/6030852.47.jpg','',137,'event_images/85aabfb1d00ecca6d666cc96c34b793948a69dc2.jpg',1),
	(67,'http://www.villagevoice.com/events/beautiful-burnout-2399809/','Beautiful Burnout','beautiful-burnout','Since making her mark on the scene with  Frozen a knockout play about a child killer, his psychiatrist, and the mother of one of his victimsBryony Lavery has taken some punches. In the midst of the play\'s triumph, she was hit with accusations of plagiarism. A lesser woman and writer might have stayed down, but Lavery came back swinging, issuing an apology and going on to write a series of formal and thematically challenging plays, often in the company of stimulating collaborators. The latest,  Beautiful Burnout , produced by the National Theatre of Scotland, is no exception. Partnering with Steven Hoggett, who did the extraordinary choreography for  Black Watch , she has created a battering, thumping, and striking play about the habitus of a Glasgow boxing gym. Previews begin tonight, opens',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/beautiful-burnout-2399809/','http://media.villagevoice.com/5995531.47.jpg','',125,'event_images/609379f6a68a05b6be95689bcb512ef0ddd3e097.jpg',1),
	(68,'http://www.villagevoice.com/events/the-importance-of-being-earnest-2276333/','The Importance of Being Earnest','the-importance-of-being-earnest','I don\'t play accurately, says a character in Oscar Wildes famed farce, any one can play accurately, but I play with wonderful expression. Lets hope that holds true for actor Brian Bedford, who will not only direct Roundabouts revival, but also assume the doughty role of Lady Bracknell.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-importance-of-being-earnest-2276333/','http://media.villagevoice.com/5821022.47.jpg','',124,'event_images/7d0fb54c674481227e66887dda383f5b88e756c4.jpg',1),
	(69,'http://www.villagevoice.com/events/the-diary-of-a-madman-2363833/','The Diary of a Madman','the-diary-of-a-madman','He won a Tony in 2009 for starring as the mentally disturbed ruler in  Exit the King . Now Geoffrey Rush stars as another neurotic in  The Diary of a Madman , based on one of Nikolai Gogols greatest short stories about a civil servant named Poprischin who is slowly being driven insane by the repressive bureaucratic system he slaves under in St. Petersburg. Rush, who originally played the lead in Australian director Neil Armfields 1989 production, reprised his role in December at the Belvoir St. Theatre in Sydney to rave reviews and, lucky us, its now here at BAM. Armfield, who also directed  Exit the King , reunites with Rush to stage the revival. Note that there is no Sunday, February 27, performance because, you know, a very important speech therapist has a special date at the Oscars.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-diary-of-a-madman-2363833/','http://media.villagevoice.com/5940471.47.jpg','',125,'event_images/0d52bc797a3a43ffe81c663cf8985bb0e3ddbcb0.jpg',1),
	(70,'http://www.villagevoice.com/events/compulsion-2346642/','Compulsion','compulsion','Instead of the  Diary of a Young Girl , playwright Rinne Groff offers a play that might be titled  The Memoirs of a Middle-Aged Man . In  Compulsion , her ingenious mingling of historical fact and fiction centers on a writer named Sid Silver (based on the real-life figure Meyer Levin). Fixated on Anne Franks diary, Silver spends much of his life in the U.S. and Israel struggling to promote the girls story and adapt it to the stagefor reasons that may seem less altruistic than they first appear. Mandy Patinkin and Hannah Cabell, as Silver and his wife, reprise their roles from the New Haven debut, and Oskar Eustis again directs this half-invented chronicle. Will it obsess audiences?',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/compulsion-2346642/','http://media.villagevoice.com/5893881.47.jpg','',125,'event_images/3c2adca1007004b8369fd46341060b8b0bb830d2.jpg',1),
	(71,'http://www.villagevoice.com/events/the-whipping-man-2314943/','The Whipping Man','the-whipping-man','At the Passover seder, one asks, Why is this night different from all other nights? That wont be difficult to answer at Matthew Lopezs singular play, staged by MTC. It concerns a Jewish confederate soldier who returns from the Civil War to prepare a seder with two of his former slaves. Director Doug Hughes hides the matzoh.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-whipping-man-2314943/','http://media.villagevoice.com/5821079.47.jpg','',125,'event_images/95f0d6b6c602062b0c510ec30ae3ff2c928763a2.jpg',1),
	(72,'http://www.villagevoice.com/events/the-so-so-glos-lady-lamb-the-beekeeper-bow-ribbons-2398561/','The So So Glos+Lady Lamb the Beekeeper+Bow Ribbons','the-so-so-gloslady-lamb-the-beekeeperbow-ribbons','',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/the-so-so-glos-lady-lamb-the-beekeeper-bow-ribbons-2398561/','','',137,NULL,1),
	(73,'http://www.villagevoice.com/events/peter-and-the-starcatcher-2377968/','Peter and the Starcatcher','peter-and-the-starcatcher','How did Peter Pan learn to fly? How did Captain Hook lose his hand? Find out the answers when Obie winner Alex Timbers (director of  Bloody Bloody Andrew Jackson ) and actor-director-writer Roger Rees co-direct the prequel to J.M. Barries classic story Peter and the Starcatcher. Adapted from the book by Ridley Pearson and Dave Barry, the story takes you on an adventure with Peter Pan and his wily gang of orphans as they gather something called starstuff. Though Disney is known for its grand musical productions, this is the first time the company is doing a stripped-down play with little scenery and a dozen actors playing roughly 50 characters. After all, bigger does not always mean better (ahem,  Spider-Man ).',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/peter-and-the-starcatcher-2377968/','http://media.villagevoice.com/5979489.47.jpg','',125,'event_images/18c03d9f0e7c3c28e81451289dc7b3d680e2c7ac.jpg',1),
