	(76,'http://www.villagevoice.com/events/the-arbor-2389364/','The Arbor','the-arbor','Dir. Clio Barnard (2009) The brief foredoomed career of slum-born self-educated playwright Andrea Dunbar is revisited to electrifying effect in this innovative documentary portrait, with actors lip-synched to actual recordings of the people they portray. HOBERMAN.',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/the-arbor-2389364/','','',173,NULL,1),
