	(101,'http://www.villagevoice.com/events/looking-again-at-picassoand-146-s-guernica-2292366/','Looking Again at Picassos Guernica','looking-again-at-picassoas-guernica','Art historian T.J. Clark will discuss Pablo Picassos painting Guernica (1937), examining how a work of such enduring political resonance emerged from Picassos deeply private and difficult artistic universe. The lecture looks at the step-by-step making of Guernica, taking advantage of the set of photographs of the work in progress taken by Dora Maar. Clark was a professor of modern art at the University of California, Berkeley from 1988  2010. His books include The Painting of Modern Life: Paris in the Art of Manet and His Followers (Princeton University Press, 1985), The Sight of Death: An Experiment in Art Writing (Yale University Press, 2006) and the forthcoming Picasso and Truth: From Cubism to Guernica. Presented by the MFA Art Criticism and Writing Department.',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/looking-again-at-picassoand-146-s-guernica-2292366/','','',34,NULL,1),
