	(104,'http://www.villagevoice.com/events/behind-the-scenes-of-dressed-2393729/','Behind the Scenes of Dressed','behind-the-scenes-of-dressed','Join director David Swajeski for an inside look at Dressed, his film about Laotian-American fashion designer Nary Manivongs journey from homelessness on the streets of Ohio to the runway at New York Fashion Week. Self-taught, Manivong was named one of 12 designers to watch by Womens Wear Daily. Following a screening of selected footage from the film, Swajeski and Manivong will be joined by Manivongs design partner, Ally Hilfiger, to talk about NAHM, their new brand.',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/behind-the-scenes-of-dressed-2393729/','','',121,NULL,1),
	(105,'http://www.villagevoice.com/events/gabrielle-hamilton-2260101/','Gabrielle Hamilton','gabrielle-hamilton','Reads from Blood, Bones, and Butter: The Inadvertent Education of a Reluctant Chef.',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/gabrielle-hamilton-2260101/','','',34,NULL,1),
	(106,'http://www.villagevoice.com/events/michael-bierut-designing-writing-teaching-not-my-real-job-2412068/','Michael Bierut: Designing, Writing, Teaching: Not My Real Job','michael-bierut-designing-writing-teaching-not-my-r','Michael Bierut has worked as a designer, writer, editor, blogger and teacher. He will describe the pleasures and perils of working for 30 years with an intentionally confusing job description. Bierut is a partner in the New York office of Pentagram Design, and was previously vice president for graphic design at Vignelli Associates. He is a recipient of the AIGA Medal and the Cooper-Hewitt National Design Museum Design Mind Award. He frequently contributes commentaries on graphic design in everyday life to the Public Radio International program Studio 360. Presented by the MFA Design Criticism Department.',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/michael-bierut-designing-writing-teaching-not-my-real-job-2412068/','','',34,NULL,1),
