	(115,'http://www.villagevoice.com/events/fat-tissue-the-good-the-bad-and-the-ugly-2398394/','Fat Tissue: the Good, the Bad and the Ugly','fat-tissue-the-good-the-bad-and-the-ugly','Introduction: Jules Hirsch (The Rockefeller University). Keynote speaker: Peter Arner (Karolinska Institute). Other speakers: Timothy J. Bartness (Georgia State University), Anthony W. Ferrante (Columbia University), Sylvie Hauguel-de Mouzon (Case Western Reserve University at MetroHealth Medical Center), Gary J. Hausman (USDA ARS), and Gerald I. Shulman (Yale University School of Medicine)  Adipose tissue contains adipokines, hormone receptors, growth factors and complex functions that affect reproduction, energy balance and the pathology of chronic diseases. Experts examine a dominant factor in chronic overnutrition: adiposity.',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/fat-tissue-the-good-the-bad-and-the-ugly-2398394/','','',34,NULL,1),
