	(119,'http://www.villagevoice.com/events/the-scratcher-sessions-643055/','\'The Scratcher Sessions\'','the-scratcher-sessions','The Voice staff\'s home away from home features solid singer-songwriter acts every Sunday. Solo acts and duos only; seek thy massive klezmer dance parties elsewhere. This week: John Ladeau.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-scratcher-sessions-643055/','http://media.villagevoice.com/5995429.47.jpg','',137,'event_images/c09fe1b95bc8979ae715956bd722afd58eaf81d9.jpg',1),
	(120,'http://www.villagevoice.com/events/re-open-ed-1639274/','Re-Open-Ed','re-open-ed','Just Blaze made it big back in 2000 when he contributed a few of the smoother tracks to Jay Z\'s  The Dynasty: Roc La Familia . He\'s since worked as a producer for just about everyone. His Santos party gives full range to his loves both obvious (contemporary hip hop and horn-heavy old soul) and unexpected (house and disco). DJ Soul got his start slinging mixtapes; now he\'s best known for his homage to J Dilla, and for serving as  Chappelle\'s Show \'s DJ. With Caribbean sounds from the Federation Sound\'s DJ Gravy, Max Glazer, and Micro Don.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/re-open-ed-1639274/','http://media.villagevoice.com/4518077.47.jpg','',137,'event_images/55b860c17212dd3e4b852968f535930a221e31bb.jpg',1),
