	(122,'http://www.villagevoice.com/events/slavic-soul-party-155084/','\'Slavic Soul Party\'','slavic-soul-party','Slavic Soul Party are Eastern Europe\'s answer to the funk (and \"Grunt\") of the J.B.\'s or, more recently, the Budos Band. On their recordings, and every Tuesday at Barbs, the 10-person brass ensemble pins Gypsy melodies against the sort of jazzy r&b horn collages you hear in movies adapted from Elmore Leonard books. The best part, though, is how they interact with their audience at their concerts, sometimes breaking the fourth wall, and really making each word in their nameespecially the lastpull its weight.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/slavic-soul-party-155084/','http://media.villagevoice.com/4232102.47.jpg','',137,'event_images/ef085bacc6fe361d955181fc29ef6875c3b278ac.jpg',1),
	(123,'http://www.villagevoice.com/events/old-number-7-stanley-john-mitchell-and-his-band-of-buddies-2412134/','Old Number 7+Stanley John Mitchell & His Band of Buddies','old-number-7stanley-john-mitchell-his-band-of-budd','',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/old-number-7-stanley-john-mitchell-and-his-band-of-buddies-2412134/','','',137,NULL,1),
	(124,'http://www.villagevoice.com/events/karthik-pandian-2285254/','Karthik Pandian','karthik-pandian','The Los Angelesbased artist  Karthik Pandian  has a way of capturing the most minimal things, like an eye or a graffitied wall, as he did in his 2008 16mm film installation called Darkroom, and heightening them with a vintage aesthetic. In his newest show,  Unearth , Pandian investigates the remnants of the Native American City of Cahokia (in Illinois). The result is his own ancient-like treasure in which he has constructed five massive pillars made of rammed earth with layers of other materials, including shells and strips of 16mm film, embedded like strata in order to show the relationship between ancient and modern cultures and the ways in which contemporary societies understand and treat the monuments of societies past.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/karthik-pandian-2285254/','http://media.villagevoice.com/5755626.47.jpg','',121,'event_images/f25ce700d6e1cc27172e64edfcf721897911495b.jpg',1),
