	(148,'http://www.villagevoice.com/events/renandeacute-e-fleming-2399811/','Rene Fleming','renae-fleming','While the word \"diva\" gets thrown around far too judiciously nowadays, there still is one irrefutable mark: A real diva has her own perfume. So cast no doubt on  Rene Fleming , one of the most gifted and glamorous American lyric sopranos to ever cross the Metropolitan Opera stage. In celebration of both the Met\'s 125th season and Fleming\'s storied career (her Desdemona in Verdi\'s  Otello  deserves an eau in itself), she has released a fragrance, La Voce, and returns to the Met stage tonight to perform Rossini\'s  Armida , a fiery tale of a troubled sorceress and her beau.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/renandeacute-e-fleming-2399811/','http://media.villagevoice.com/5995533.47.jpg','',132,'event_images/ce11c4a74b57c845eb0467f9b080730cd0868ef8.jpg',1),
	(149,'http://www.villagevoice.com/events/sobibor-oct-14-1943-4-p-m-2398763/','Sobibor, Oct. 14, 1943, 4 p.m','sobibor-oct-14-1943-4-pm','Dir. Claude Lanzmann (2001).\nClaude Lanzmann\'s feature-length footnote to Shoah interviews Yehuda Lerneronce upon a time, a 16-year-old participant in a death-camp uprising. His account of this impossible struggle is a mysterious, suspenseful illumination.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/sobibor-oct-14-1943-4-p-m-2398763/','http://media.villagevoice.com/5992491.47.jpg','',29,'event_images/56b817896cf5ab37fa14e72a83c3cec4ac05061f.jpg',1),
	(150,'http://www.villagevoice.com/events/american-idiot-1707430/','American Idiot','american-idiot','Between \"Lust for Life\" \'s revival as a Carnival Cruise jingle and the agonizing walk past the John Varvatos store where CBGB\'s used to be, it\'s no secret that punk-rock culture has seen some ugly lows. Green Day\'s Broadway musical  American Idiot , however, may just carve out a mosh pit for itself among these contenders. Tony-winning director Michael Mayer ( Spring Awakening ) is behind this venture, which features songs from the  American Idiot  and  21st Century Breakdown  albums. The show premiered at the Berkeley Rep and earned a range of decent to glowing reviews. From what we can tell, expect lots of heavily stylized thrashing and sets that make for a candy-colored faux-boho vibe not wholly unlike  Rent . John Gallagher Jr., who won a Tony for his role in  Spring Awakening , stars as the jaded suburbanite slacker Johnny.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/american-idiot-1707430/','http://media.villagevoice.com/4553433.47.jpg','',124,'event_images/477aff77ccf9c1d8ed07db87e7144deb76c04123.jpg',1),
	(151,'http://www.villagevoice.com/events/hope-gangloff-2363490/','Hope Gangloff','hope-gangloff','Hope Gangloff  often employs her friends to be the subjects of her lovely paintings and drawingsand lucky for her, they all happen to be very hip, effortlessly chic bohemian types. So its no surprise that her work should regularly appear in such publications as  Vice  and  Spin  and on clothing for the preppy-punk label Built by Wendy. Tonight, visit Gangloff and her many friends at the art opening party for her fourth solo exhibit at Susan Inglett Gallery.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/hope-gangloff-2363490/','http://media.villagevoice.com/5919948.47.jpg','',127,'event_images/c6083bf34ea7b550ba5789724aac766f08c2ca39.jpg',1),
	(152,'http://www.villagevoice.com/events/a-visitor-from-the-living-2398761/','A Visitor From the Living','a-visitor-from-the-living','Claude Lanzmann, 1997).\nCut from Shoah, this 65 minute interview with the Red Cross representative who filed a positive report on the Nazi model ghetto Theresienstadt is a compelling demonstration of well-meaning denial.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/a-visitor-from-the-living-2398761/','http://media.villagevoice.com/5992485.47.jpg','',29,'event_images/bda6e31113f036b541bab9ddbb83cced55f0f437.jpg',1),
	(153,'http://www.villagevoice.com/events/rock-of-ages-934355/','Rock of Ages','rock-of-ages','Rock of Ages, the celebrated hymn based on First Corinthians, will not appear in this Broadway musical. Instead expect the hits of Foreigner, Styx, Pat Benatar, and Journey sung by a cast that includes American Idol\'s Constantine Maroulis (who was nominated for a Tony). The nominal plot centers on a romance conducted in the unsalubrious environs of the Sunset Strip circa 1987.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/rock-of-ages-934355/','http://media.villagevoice.com/3150071.47.jpg','',124,'event_images/75697826ddc7573078abf110038daf75e4ed34a8.jpg',1),
	(154,'http://www.villagevoice.com/events/smith-westerns-unknown-mortal-orchestra-2412076/','Smith Westerns+Unknown Mortal Orchestra','smith-westernsunknown-mortal-orchestra','',NULL,'2011-03-08 14:00:20','2011-03-08 14:00:20','http://www.villagevoice.com/events/smith-westerns-unknown-mortal-orchestra-2412076/','','',137,NULL,1),
	(155,'http://www.villagevoice.com/events/brooklyn-boulders-1434611/','Brooklyn Boulders','brooklyn-boulders','Have you ever stared longingly at the Brooklyn Bridge and thought, I wish I could climb that?  Brooklyn Boulders , an 18,000-square-foot refuge for the urban climber located near the Gowanus, is happy to give you a shot. In addition to providing massive synthetic boulders, 360-degree climbing rooms, and 30-foot walls, Brooklyn Boulders even has a mock-up of the Brooklyn Bridge for patrons to exercise dreams of climbing local monuments. A Learn the Ropes class for beginners costs $60 and includes two-day passes and rental gear. But perhaps most attractive to the skinny-jeans crowd (and youll see a lot of them here on the weekends) is the dance-club-volume stereo system that cranks out rock while you get in shape.',NULL,'2011-03-08 14:00:20','2011-03-15 00:19:19','http://www.villagevoice.com/events/brooklyn-boulders-1434611/','http://media.villagevoice.com/4004175.47.jpg','',4,'event_images/29b5d382c9f45efe8a648b62f98e75ef94d2602e.jpg',1),
