	(254,'http://www.villagevoice.com/events/laurel-nakadate-2347919/','Laurel Nakadate','laurel-nakadate','They say crying is good for you; if thats true,  Laurel Nakadate  is doing just dandy. One photographic portion of  Only the Lonely  chronicles the artist before, during, and after weeping every day for a year. Being that this is Nakadates first large-scale museum exhibition, were guessing those are tears of joy. If photographs of private moments of sadness arent voyeuristic enough, check out what else is on view: videos from the past decade, in which the artist danced, posed, or played dead in the homes of anonymous men; and recent photos exploring the adolescent female body, for which Nakadate entered young womens bedrooms while they were sleeping, woke them, and told them to strip to their underwear.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/laurel-nakadate-2347919/','http://media.villagevoice.com/5893754.47.jpg','',127,'event_images/dbe6d65b28c6a0aeec8551c10f93f2fe885daf8e.jpg',1),
	(255,'http://www.villagevoice.com/events/material-lab-2388433/','Material Lab','material-lab','There have been countless times that weve strolled through MOMA, come upon an arousing piece, and dug in our bag looking for a pen to make a note for later inspiration. But what if you could create your own artwork inspired by the eclectic ambience of the museum right there and then? The new  Material Lab  allows you to do that, and, even better, you dont have to bring your entire collection of scraps, paints, pencils, Crayons, glue sticks, or anythingthey provide all the supplies! The interactive space also includes a digital painting program, so you can take your art on-the-go, leave it to inspire others, or start your own gallery in your living room. The possibilities are endless.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/material-lab-2388433/','http://media.villagevoice.com/5968238.47.jpg','',127,'event_images/c98eb4e206da365645dcdc18c3b3b981f80804ed.jpg',1),
	(256,'http://www.villagevoice.com/events/long-march-restart-2008-2303136/','Long March: Restart 2008','long-march-restart-2008','And you thought gaming on your big flat-screen TV was fun? Beijing-based artist Feng Mengbo invites viewers to pick up a wireless controller and get into the action with his interactive video-game installation  Long March: Restart 2008 . Blending propaganda from Communist China with imagery from classic games such as  Street Fighter II  and  Super Mario Bros. , Mengbo has created a fully functioning video game in eight large-scale projections that requires you to actually walk along with the hero, a Red Army soldier, as he faces down the enemy in dangerous territory.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/long-march-restart-2008-2303136/','http://media.villagevoice.com/5788914.47.jpg','',127,'event_images/d46ab7cb6ae82b7bc912fdaae2d9e13e2c0f293e.jpg',1),
	(257,'http://www.villagevoice.com/events/melissa-auf-der-maur-2406189/','Melissa Auf der Maur','melissa-auf-der-maur','A film, a comic, other assorted media accoutrements:  Out of Our Minds , Melissa Auf der Maur\'s second and long-time-coming 2010 solo album, came with everything but a rebate for Shake Weights. An ambitious if largely hook-free alchemy of \'90s alt posturing, Viking barbarism, and Danzig guest shots, the album nevertheless established former Hole bassist \"MAdM\" (natch) as a strong artist for a new age of dream metal nerds. She is your queen. Note that animal sacrifices are prohibited at Highline Ballroom. With the Shining Twins and Leah Siegel.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/melissa-auf-der-maur-2406189/','http://media.villagevoice.com/6031411.47.jpg','',137,'event_images/4cba5d8f6083799a4e435ddaa374ec27e6d9fe7a.jpg',1),
	(258,'http://www.villagevoice.com/events/arborea-2413967/','Arborea','arborea','Psychedelia and neo-folk are in multicultural array tonight, and their tension is universal: These artists all reside in quiet singer-songwriter moments but have the intensity of far more scabrous acts. Maines  Arborea  chirp coyly with woodsy, autumnal banjo plucking, joined tonight by Helena Espvall of Espers on cello. Espvall, a Swedish multi-instrumentalist, will also perform a solo set of free improv, hopefully also cherry-picking from her two albums of native folk songs with Tokyo musician Masaki Batoh. Local player Matteah Baim, formerly of hard rock outfit Metallic Falcons, rounds out the set with her nuanced, assertive solo fare.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/arborea-2413967/','http://media.villagevoice.com/6023776.47.jpg','',137,'event_images/a1b1096c8f5a81da64945674454fbba2613db6f0.jpg',1),
	(259,'http://www.villagevoice.com/events/tennis-2399891/','Tennis','tennis','We\'re just gonna say it:  Tennis  beats Hockey. The Denver husband-and-wife duo, Patrick Riley and Alaina Moor, are romantic souls, having recently completed an eight-month sailing journey along the Atlantic coastline. The delectably expansive, thoughtfully versed folk of January\'s  Cape Dory  (named after, yes, a type o\' yacht) benefits from their shared wanderlust; the title track alone is something Daniel Johnston would tip his cap to. With La Ser anad Holiday Shores.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/tennis-2399891/','http://media.villagevoice.com/5995693.47.jpg','',137,'event_images/6930336a753d0af25ab026a64dfee027be2f8c8b.jpg',1),
	(260,'http://www.villagevoice.com/events/tennis-2406051/','Tennis','tennis','For anyone who ever fantasized that She & Him is a real husband/wife duo, meet Tennis. The Denver pair\'s button-cute beach tunes (inspired by a seven month sailing sojourn) combine dreams of polo-clad love affairs at sea with the novel quality of reverb-drenched tunes you can actually hum along to. They\'re a throwback that works, thanks to Alaina Moore\'s sincere crooning and the band\'s doo-wop harmonies. The East Coast is the best coast, after all. With the fitting La Sera and Holiday Shores.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/tennis-2406051/','http://media.villagevoice.com/6030886.47.jpg','',137,'event_images/46f1dea6e647411f106212dd49337e78501baf26.jpg',1),
	(261,'http://www.villagevoice.com/events/selected-shorts-stories-from-electric-literature-2403337/','Selected Shorts: Stories From Electric Literature','selected-shorts-stories-from-electric-literature','Electric Literature , the literary magazine founded in 2009 by Andy Hunter and Scott Lindenbaum, brings wonderful short stories not only to your bookstore, but to your iPhone, iPad, Kindle, and ebook as well. And now you can hear them on the stage as part of Symphony Space\'s \"Selected Shorts\" series. Comedian Mike Birbiglia ( Sleepwalk with Me ), John Lithgow, Aya Cash ( Traffic Light ), and David Rakoff perform new stories from the magazine by Rick Moody, Lydia Millet, and Joy Williams.\nFree rum drink for all ticketholders before the show and during intermission.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/selected-shorts-stories-from-electric-literature-2403337/','http://media.villagevoice.com/6009448.47.jpg','',34,'event_images/6a1c88c578c4991fff6be067e1c4150565ba2f56.jpg',1),
	(262,'http://www.villagevoice.com/events/vienna-teng-and-alex-wong-2390718/','Vienna Teng & Alex Wong','vienna-teng-alex-wong','After four studio albums full of erudite flourish, stately piano balladry, and pleasant nods to the \'90s female singer-songwriter canon, Vienna Teng collaborated with vocalist and multi-instrumental whiz Alex Wong for the 2010 live recording  A Moment Always Vanishing . It was an apt title for a set where creative eddies often ran beautifully concurrent to the main action, and a surprise finale of a Radiohead cover acknowledged both artists\' appreciation for the group\'s strength in ambiguity. Expect the duo to create the shifting  Vanishing  landscape on stage. With Justin Jones.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/vienna-teng-and-alex-wong-2390718/','http://media.villagevoice.com/5995380.47.jpg','',137,'event_images/defd9090a1a6755cb13f55ffd65a75b5c2df774d.jpg',1),
	(263,'http://www.villagevoice.com/events/the-pretty-reckless-2411731/','The Pretty Reckless','the-pretty-reckless','As faithful  Us Weekly  readers already know, the Pretty Reckless is  Gossip Girl  star Taylor Momsen\'s sassed-out grunge-pop outfit. You can tell she\'s aiming for prime era Hole on  Light Me Up , the band\'s newly released debut, but more often than not, she ends up closer to Wolfmother. Good thing? Bad thing? Your call.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/the-pretty-reckless-2411731/','http://media.villagevoice.com/6030834.47.jpg','',137,'event_images/a0ff778e1bbb7af96d2068a7d21079b225f4a580.jpg',1),
	(264,'http://www.villagevoice.com/events/sam-lipsyte-2399883/','Sam Lipsyte','sam-lipsyte','If you\'ve yet to read  Sam Lipsyte \'s  The Ask , we have just one question: What\'s the hold-up? One of the funniest books of 2010, the story concerns Milo Burke, a struggling father and husband who is given one last shot at keeping his job as a development officer at a university if he can woo a mysterious potential donor. The only catch is: The donor has a difficult favor to ask him as well. As our Rob Harvilla said in his review: \"If you\'re the sort of person who underlines amusing or thought-provoking lines in books, you best gird yourself, as Lipsyte is an inexhaustible fount of eloquent prurience, deftly mingling high- and low-mindedness.\" Tonight, join Lipsyte and the book\'s editor, Lorin Stein (also the editor of  The Paris Review ), at the launch party for the paperback edition of  The Ask  and the re-release of Lipsyte\'s  The Subject Steve . Drinks will be served.',NULL,'2011-03-08 14:00:21','2011-03-15 00:19:19','http://www.villagevoice.com/events/sam-lipsyte-2399883/','http://media.villagevoice.com/5995635.47.jpg','',34,'event_images/caddfff4ad24beff9e32f88d95fddd64fdbb29bc.jpg',1),
