	(267,'http://www.villagevoice.com/events/concert-timbalooloo-with-oran-etkin-2358690/','Concert: Timbalooloo with Oran Etkin','concert-timbalooloo-with-oran-etkin','From the music of Africa to klezmer and jazz, Oran Etkin\'s whimsical performances blend global melodies and rhythms into a gumbo of goodness. Enjoy tunes from his beloved album, Wake Up, Clarinet! and more.',NULL,'2011-03-08 14:00:21','2011-03-08 14:00:21','http://www.villagevoice.com/events/concert-timbalooloo-with-oran-etkin-2358690/','','',121,NULL,1),
