	(270,'http://www.villagevoice.com/events/milstein-science-series-under-the-sea-inside-the-mind-2406142/','Milstein Science Series: Under the Sea, Inside the Mind','milstein-science-series-under-the-sea-inside-the-m','Discover what scientists are learning about the evolution of the brain, intelligence, and self-awareness of ocean- dwelling animals such as dolphins, whales, and manatees. This special afternoon presentation will feature biologists Lori Marino of Emory University, Roger Reep of the University of Florida, and Hal Whitehead of Dalhousie University in Nova Scotia. The program will be introduced by Melanie Stiassny, Axelrod Research Curator in the Museums Department of Ichthyology.',NULL,'2011-03-08 14:00:21','2011-03-08 14:00:21','http://www.villagevoice.com/events/milstein-science-series-under-the-sea-inside-the-mind-2406142/','','',34,NULL,1),
