	(491,'http://www.villagevoice.com/events/parentand-150-child-workshops-1584173/','ParentChild Workshops','parentachild-workshops','Art programs for children of Members at the Family/Dual ($190) level and above offer children the unique experience of learning about art and creating their own works in the Museum. These classes are designed to provide adults and children with an opportunity to explore and discover art in a studio setting as well as in the Museum\'s galleries. All gallery visits focus on visual art concepts: line, shape, color, pattern, texture, balance, and form. Activities include painting, collage, sculpting, building, viewing works from the Museum\'s collection, and listening to related stories and fables.  For more information about this class, please call 2126502819.',NULL,'2011-03-08 14:00:22','2011-03-13 14:02:08','http://www.villagevoice.com/events/parentand-150-child-workshops-1584173/','','',121,NULL,1),
