	(495,'http://www.villagevoice.com/events/journey-to-the-stars-1804212/','Journey to the Stars','journey-to-the-stars','Journey to the Stars, an all-new Hayden Planetarium space show narrated by Academy Awardwinning actress Whoopi Goldberg, launches visitors through time and space to experience the life and death of the stars in our night sky. Audiences travel 13 billion years into the past, when the first stars were born, and witness brilliant supernova explosions that sent new kinds of matter coursing through the universe, into the atoms of our own bodies and the air we breathe. They visit the heart of our fiery Sun, and glimpse its eventual demise as it transforms into a massive red giant some five billion years in the future. Visitors tour stellar formations, explore new celestial mysteries, and discover the fascinating, unfolding story that connects us all to the stars.',NULL,'2011-03-08 14:00:22','2011-03-11 23:53:57','http://www.villagevoice.com/events/journey-to-the-stars-1804212/','','',28,NULL,1),
