	(499,'http://www.villagevoice.com/events/take-me-to-the-water-photographs-of-river-baptisms-2322955/','Take Me to the Water: Photographs of River Baptisms','take-me-to-the-water-photographs-of-river-baptisms','Religious rituals in America are not often public spectacles. A key exception was the tradition of river baptisms that flourished in the South and Midwest between 1880 and 1930. These outdoor communal rites were public displays of faith, practiced by thousands of Protestants, and witnessed by whole communities.',NULL,'2011-03-08 14:00:22','2011-03-11 23:45:34','http://www.villagevoice.com/events/take-me-to-the-water-photographs-of-river-baptisms-2322955/','','',127,NULL,1),
	(500,'http://www.villagevoice.com/events/the-great-upheaval-modern-art-from-the-guggenheim-collection-1910and-150-1918-2285157/','The Great Upheaval: Modern Art from the Guggenheim Collection, 19101918','the-great-upheaval-modern-art-from-the-guggenheim-','Featuring more than one hundred paintings, sculptures, and works on paper by Umberto Boccioni, Marc Chagall, Marcel Duchamp, Kandinsky, Fernand Lger, Kazimir Malevich, Marc, and Pablo Picasso, among others, The Great Upheaval attests to this period of collaboration, interchange, synthesis, and innovation.',NULL,'2011-03-08 14:00:22','2011-03-11 23:44:02','http://www.villagevoice.com/events/the-great-upheaval-modern-art-from-the-guggenheim-collection-1910and-150-1918-2285157/','','',121,NULL,1),
	(501,'http://www.villagevoice.com/events/stieglitz-steichen-strand-2289188/','Stieglitz, Steichen, Strand','stieglitz-steichen-strand','This exhibition features three giants of photographyAlfred Stieglitz (American, 18641946), Edward Steichen (American, b. Luxembourg, 18791973), and Paul Strand (American, 18901976)whose works are among the Metropolitan\'s greatest photographic treasures. The diverse and groundbreaking work of these artists will be revealed through a presentation of approximately 115 photographs, drawn entirely from the collection.',NULL,'2011-03-08 14:00:22','2011-03-11 23:42:26','http://www.villagevoice.com/events/stieglitz-steichen-strand-2289188/','','',121,NULL,1),
	(502,'http://www.villagevoice.com/events/singular-visions-2406281/','Singular Visions','singular-visions','With our latest re-installation of the permanent collection galleries, the Whitney invites visitors to slow down and experience art in a dramatic new way. Twelve major postwar works, many of which have not been exhibited in years, are presented in their own rooms, creating spaces for intimate and powerful encounters with a single work of art. The variety of mediums and sizes from small to sprawling reveal how artists of the last five decades have stretched the boundaries of what an artwork can be.',NULL,'2011-03-08 14:00:22','2011-03-11 23:40:53','http://www.villagevoice.com/events/singular-visions-2406281/','','',121,NULL,1),
	(503,'http://www.villagevoice.com/events/the-deutsche-bank-series-at-the-guggenheim-found-in-translation-2285175/','The Deutsche Bank Series at the Guggenheim: Found in Translation','the-deutsche-bank-series-at-the-guggenheim-found-i','The works in Found in Translation explore the intersections between past political and cultural figures and contemporary history and fantasy, transposed from one culture to another through written or spoken text.',NULL,'2011-03-08 14:00:22','2011-03-11 23:24:22','http://www.villagevoice.com/events/the-deutsche-bank-series-at-the-guggenheim-found-in-translation-2285175/','','',121,NULL,1),
	(504,'http://www.villagevoice.com/events/slater-bradley-and-ed-lachman-shadow-2406279/','Slater Bradley and Ed Lachman: Shadow','slater-bradley-and-ed-lachman-shadow','Shadow, a new video work by Slater Bradley in collaboration with cinematographer Ed Lachman, takes as its inspiration the unfinished Hollywood film Dark Blood (1993), which was never completed due to the untimely death of its star, River Phoenix. Seventeen years later, Shadow presents a kind of prologue to the original film, revisiting Phoenixs character while creating a new narrative which, when woven together with the original, creates a labyrinthine take that blurs the lines between illusion and reality.',NULL,'2011-03-08 14:00:22','2011-03-11 23:14:46','http://www.villagevoice.com/events/slater-bradley-and-ed-lachman-shadow-2406279/','','',127,NULL,1),
