	(512,'http://www.villagevoice.com/events/you-are-a-sentence-full-of-holes-2348534/','You Are A Sentence Full of Holes','you-are-a-sentence-full-of-holes','What happens to time when the watch stops? When do objects become landscape? With Luis Camnitzer as a point of departure create collages in collaboration with contemporary artist s inspired by these and other questions, all materials provided.',NULL,'2011-03-08 14:00:22','2011-03-11 20:38:11','http://www.villagevoice.com/events/you-are-a-sentence-full-of-holes-2348534/','','',121,NULL,1),
	(513,'http://www.villagevoice.com/events/hey-whereand-146-s-my-robot-girlfriend-an-exploration-of-sexual-robotics-teledildonics-and-carnal-technology-2393867/','Hey, Wheres My Robot Girlfriend? An Exploration of Sexual Robotics, Teledildonics and Carnal Technology','hey-whereas-my-robot-girlfriend-an-exploration-of-','Robot brides, sex machines, even vibrators  technology and sexuality have long been intertwined as part of our cultural consciousness.  At this illustrated lecture, sexual health researcher Lauren G. Duncan speaks about the possibilities of sexual technology, shatters the dichotomy between natural and technological,and analyzes how society conceptualizes sexuality, science, and ourselves.',NULL,'2011-03-08 14:00:22','2011-03-11 20:36:53','http://www.villagevoice.com/events/hey-whereand-146-s-my-robot-girlfriend-an-exploration-of-sexual-robotics-teledildonics-and-carnal-technology-2393867/','','',142,NULL,1),
	(514,'http://www.villagevoice.com/events/johnny-porkpies-bad-ideas-2405891/','Johnny Porkpie\'s Bad Ideas','johnny-porkpies-bad-ideas','The Mayor of Burlesque is back with his own game show. In a contest only Johnny Porkpie could conceive, audience members are contestants and burlesque stars are the hosts. As the burlesque stars strip, tease, and shake, they give hints to questions about their provocations  hints to whiich the audience members must play close attention, because you never know who might get picked to grab some junk. Oh, that\'s the other part. Winning contestants win, at first, junk from the stars\' house  an old DVD, a torn smurf, etc. But, those who make it to the tantilizing top of the tippy top can trade their junk in for real prizes, only they have to reach down Porkpie\'s pants and grab his junk to get it.',NULL,'2011-03-08 14:00:22','2011-03-11 20:35:26','http://www.villagevoice.com/events/johnny-porkpies-bad-ideas-2405891/','','',28,NULL,1),
	(515,'http://www.villagevoice.com/events/sarah-vowell-unfamiliar-fishes-reading-2382790/','Sarah Vowell ','sarah-vowell','NPR favorite and American history buff Sarah Vowell delivers another dose of her trademark witty cultural commentary with a fresh look at how America annexed Hawaii. The weird is celebrated along with the tragic, and her modern day inclusion of Obama\'s childhood brings the state\'s story full circle.',NULL,'2011-03-08 14:00:22','2011-03-11 20:34:23','http://www.villagevoice.com/events/sarah-vowell-unfamiliar-fishes-reading-2382790/','','',34,NULL,1),
	(516,'http://www.villagevoice.com/events/backstage-dior-2387476/','Backstage Dior','backstage-dior','Join photographer Roxanne Lowit and Simon Doonan, creative ambassador-at-large at Barneys, for a lively discussion of Lowits latest book, Backstage Dior. This new collection of photographs opens a door on life behind the scenes at the John Galliano fashion shows, which Lowit has been chronicling for more than a decade. Event followed by book signing.',NULL,'2011-03-08 14:00:22','2011-03-08 14:00:22','http://www.villagevoice.com/events/backstage-dior-2387476/','','',121,NULL,1),
