	(529,'http://www.villagevoice.com/events/monday-night-bingo-433988/','Monday Night Bingo','monday-night-bingo','How many creative ways can one call out \"O-69\"? Leave it up to Linda Simpson and Murray Hill, denizens of the downtown gaming world, to try and get a rise out of the jackpot-hungry players when that fateful coordinate comes up.  Monday Night Bingo  has brought their innuendos, wisecracks, and truly bizarre prize booty to the masses as they\'ve hopped clubs over the years. In the wake of the dear Rapture Caf\'s demise, Bingo lives on at the Bowery Poetry Club. Expect the usual silly wares for winners, such as a remote-control fart machine and VHS-format porn.',NULL,'2011-03-08 14:00:22','2011-03-15 00:19:20','http://www.villagevoice.com/events/monday-night-bingo-433988/','http://media.villagevoice.com/2599502.47.jpg','',170,'event_images/390d1cbb56f0c73d4a8adc5fe7d1b389267f3af1.jpg',1),
