	(558,'http://www.villagevoice.com/events/tibor-de-nagy-gallery-painters-and-poets-2322968/','Tibor de Nagy Gallery Painters and Poets','tibor-de-nagy-gallery-painters-and-poets','The Tibor de Nagy Gallery marks its 60th anniversary with \"Tibor de Nagy Gallery Painters and Poets\", an exhibition celebrating the gallerys pivotal role in launching the New York School of Poets and fostering a new collaborative ethos among poets and painters in post-War New York. The exhibition focuses on the gallerys first two decades, the 1950s and 60s, when its vibrant, salon-like atmosphere and director John Bernard Myers passion for both art and poetry gave birth to these unique partnerships.',NULL,'2011-03-08 14:00:22','2011-03-11 17:55:31','http://www.villagevoice.com/events/tibor-de-nagy-gallery-painters-and-poets-2322968/','','',171,NULL,1),
