	(561,'http://www.villagevoice.com/events/luis-camnitzer-2083269/','Luis Camnitzer','luis-camnitzer','Luis Camnitzer is an internationally recognized artist, as well as a critic, educator and art theorist. Allied with conceptual art, Camnitzer has developed an essentially autonomous oeuvre. His work is unmistakably distinguished from that of his colleagues by its acutely observed detail and lyrical qualities, acerbic wit, ironically metaphorical polyvalence, and solid socio-political commitment. This exhibition is part of El Museos FOCOS series highlighting the achievements of mature, under-recognized artists.',NULL,'2011-03-08 14:00:22','2011-03-11 17:41:00','http://www.villagevoice.com/events/luis-camnitzer-2083269/','','',171,NULL,1),
