	(1169,'http://www.villagevoice.com/events/laurie-anderson-2322917/','Laurie Anderson','laurie-anderson','Musician and performance artist Laurie Anderson creates large-scale theatrical works that combine music, video, storytelling, projected imagery and sculpture. She has left an indelible imprint on culture, through her invention of the tape-bow violin, her hit single O Superman, her concert film Home of the Brave, her work with Andy Kaufman, Robert Wilson, Spalding Gray, Trisha Brown, William S. Burroughs and her husband Lou Reed, her stint as NASAs artist-in-residence and theatrical works like United States, The Nerve Bible, and 2010s Delusion. Wired Magazine calls her Americas multi-mediatrix..',NULL,'2011-03-08 14:00:26','2011-03-21 10:11:17','http://www.villagevoice.com/events/laurie-anderson-2322917/','','',34,'',1),
