	(1172,'http://www.villagevoice.com/events/and-147-ismsand-148-and-and-147-istsand-148-the-modernist-group-in-the-1910s-2393716/','Isms and Ists: The Modernist Group in the 1910s','aismsa-and-aistsa-the-modernist-group-in-the-1910s','The 1910s witnessed an explosion of modernist groups.  In the visual arts alone, prominent groups included the Italian Futurists, the Parisian Cubists and Orphists, Der Blaue Reiter of Munich, Die Brcke of Berlin, the London Vorticists, and the Russian Rayists. What accounts for this burgeoning?  What made groups so appealing to artists in these years?  More importantly, was this surge in modernist groups related to the accelerating innovation in all the arts of these years? Isms and Ists will address these questions and conclude with examples of how one group in particular, the Italian Futurists, influenced artists from London to Munich to Moscow. Cohens essay Artists Write! Manifestos and Books in 1912 appears in The Great Upheaval exhibition catalogue.',NULL,'2011-03-08 14:00:26','2011-03-21 09:32:40','http://www.villagevoice.com/events/and-147-ismsand-148-and-and-147-istsand-148-the-modernist-group-in-the-1910s-2393716/','','',34,'',1),
