	(1314,'http://www.villagevoice.com/events/nik-bandauml-rtsch-and-ronin-2399875/','Nik Brtsch and Ronin','nik-bartsch-and-ronin','The aquatic undercurrent of  Nik Brtsch and Ronin \'s most recent ECM album,  Llyria , echoes the keyboardist-composer\'s description of his decade-old quintet\'s music: \"It reminds me of a school of fish moving across a coral reef with lightning speed. Are the fish faster than thought?\" Ronin\'s meticulously interwoven and unbelievably through-composed \"modules,\" subtle jewels of pliant minimalism, suggest an answer in the affirmative. Saxophone (or bass clarinet), bass, drums, keyboard, and percussion feint and flicker with uncanny precision. Ronin plays its highly disciplined \"ritual groove music\" every Monday night at Brtsch\'s Zurich club, and their Swiss-timepiece precisionwhich at times resembles an acoustic King Crimson on the q.t. or Steve Reich at a Zen retreatis enlivened by ghostly improvised subtleties.',NULL,'2011-03-08 14:00:27','2011-03-15 00:19:21','http://www.villagevoice.com/events/nik-bandauml-rtsch-and-ronin-2399875/','http://media.villagevoice.com/5995632.47.jpg','',137,'event_images/986f79aae453a7ed54dbcb6afd27b71f09af85ad.jpg',1),
	(1315,'http://www.villagevoice.com/events/jessica-6-2394188/','Jessica 6','jessica-6','These former Hercules & Love Affair folks stoke fond memories of CeCe Peniston\'s \"Finally\" and Lisa Stansfield\'s \"All Around the World\" on  See the Light , their disco-soul debut due in May. Tonight\'s is a dangerously early show, though: Are people ready to dance before 8? With Emilie Simon.',NULL,'2011-03-08 14:00:27','2011-03-15 00:19:21','http://www.villagevoice.com/events/jessica-6-2394188/','http://media.villagevoice.com/5995389.47.jpg','',137,'event_images/23e7022a4d1925ff01983bb75daf775ce9eaf798.jpg',1),
