	(1319,'http://www.villagevoice.com/events/joel-frahm-2399737/','Joel Frahm','joel-frahm','The tenor sax whiz is known mostly to those in the know, a conundrum that needs to be rectified tout de suite--his mix of beauty and brawn should be heard by everyone around. Frahm\'s forte is gliding through standards, bending them to fit his vision, and imbuing it with personalized grace. See that 2004 \"Oleo\" duet with Brad Mehldau for proof. This show will be mic\'d up for a live album, and guitarist Kurt Rosenwinkel should be a provocative foil for his old pal.',NULL,'2011-03-08 14:00:27','2011-03-15 00:19:21','http://www.villagevoice.com/events/joel-frahm-2399737/','http://media.villagevoice.com/5995325.47.jpg','',137,'event_images/05acdea4d83ac7aa992f9b67000a31dd197716d4.jpg',1),
	(1320,'http://www.villagevoice.com/events/the-arbor-2398777/','The Arbor','the-arbor','Dir. Clio Bernard (2010).\nThe brief foredoomed career of slum-born self-educated playwright Andrea Dunbar is revisited to electrifying effect in this innovative documentary portrait, with actors lip-synched to actual recordings of the people they portray.',NULL,'2011-03-08 14:00:27','2011-03-15 00:19:21','http://www.villagevoice.com/events/the-arbor-2398777/','http://media.villagevoice.com/5992632.47.jpg','',29,'event_images/6de64e221e906a391203fef10f679ae9bb928780.jpg',1),
