	(1323,'http://www.villagevoice.com/events/ben-and-vesper-2399735/','Ben & Vesper','ben-vesper','New Jersey marrieds Ben and Vesper Stamper fluttered in from the Sufjan universe. With rich harmonies in the vein of other people who love each other (Low, Mates of State), a raft of parlor instruments, and assists from cuckoos like Danielson, their two studio albums are an agreeable mishmash of familiar meaning and affectation. ( Honors , their newest, appeared last month via Sounds Familyre.) They\'re touring \"organically,\" with a tiered reward system for donations that will help pay for \"food, travel, babysitting, and other tour expenses.\" Too bad Sufjan\'s flock of giant myna birds don\'t take passengers.',NULL,'2011-03-08 14:00:27','2011-03-15 00:19:21','http://www.villagevoice.com/events/ben-and-vesper-2399735/','http://media.villagevoice.com/5995317.47.jpg','',137,'event_images/71d12770be88a3f14dc5db554c8a3e61ffbde1f5.jpg',1),
