	(1331,'http://www.villagevoice.com/events/simon-lovells-strange-and-unusual-hobbies-155037/','Simon Lovell\'s Strange and Unusual Hobbies','simon-lovells-strange-and-unusual-hobbies','Lovell, a British con man with a rubber smile, finds lawful uses for his former hustling techniques in this one-man show of stunts, tricks, and yarn spinning. An unboozed audience may find the magic and jokes pretty lame (his defensive outbursts when the recycled shtick bombs are invariably funnier than the shtick itself). But after watching how effortlessly this cardsharp can stack the deck, you\'ll definitely cancel your next trip to Vegas. RAMPELL.',NULL,'2011-03-08 14:00:27','2011-03-08 14:00:27','http://www.villagevoice.com/events/simon-lovells-strange-and-unusual-hobbies-155037/','','',125,NULL,1),
